import numpy as np

def prime_multiples(num, start, end):
    """"""

    def is_prime(n):
        if n <= 1 or (n % 2 == 0 and n > 2):
            return False
        return all((n % i for i in range(3, int(np.sqrt(n)) + 1, 2)))
    multiples = []
    i = 1
    while num * i <= end:
        if num * i >= start:
            multiples.append(num * i)
        i += 1
    prime_multiples = [x for x in multiples if is_prime(x)]
    return prime_multiples
